import React from "react";
import logo from "./logo.svg";
import "./App.css";

function App() {
  interface Shape {
    color: string;
  }
  interface PenStroke {
    penWidth: number;
  }
  interface Square extends Shape, PenStroke {
    sideLength: number;
  }
  let square: Square = {
    color: "blue",
    penWidth: 10,
    sideLength: 10,
  };
  return <div className="App">11</div>;
}

export default App;
